<td headers="stub_1_43 description" class="gt_row gt_left" style="font-size: small; font-weight: lighter;">Hospital-Acquired Condition (HAC) Reduction Program (HACRP) - In October 2014, CMS began reducing Medicare fee-for-service payments for subsection (d) hospitals that rank in the worst-performing quartile with respect to hospital-acquired condition (HAC) quality measures. Hospitals with a Total HAC Score above the 75th percentile of the Total HAC Score distribution will be subject to a 1-percent payment reduction. This table contains hospitals' measure and Total HAC scores. The Total HAC Score is calculated as the equally weighted average of hospitals' individual measure scores.</td>
