<td headers="stub_1_60 keyword" class="gt_row gt_left" style="font-size: small; font-weight: lighter;">Medicare Spending per Beneficiary</td>
<td headers="stub_1_60 description" class="gt_row gt_left" style="font-size: small; font-weight: lighter;">The Medicare Spending Per Beneficiary (MSPB) Measure shows whether Medicare spends more, less, or about the same for an episode of care (episode) at a specific hospital compared to all hospitals nationally. An MSPB episode includes Medicare Part A and Part B payments for services provided by hospitals and other healthcare providers the 3 days prior to, during, and 30 days following a patient's inpatient stay. This measure evaluates hospitals' costs compared to the costs of the national median (or midpoint) hospital. This measure takes into account important factors like patient age and health status (risk adjustment) and geographic payment differences (payment-standardization).</td>
