  url_modify_query(
    `properties[]`            = "state",
    `properties[]`            = "overall_rating",
    `conditions[0][property]` = "overall_rating",
    `conditions[0][value]`    = 3,
    `conditions[0][operator]` = ">",
    offset                    = 0, 
    limit                     = 2000) |> 
  url_build() |> 
  request() |> 
  req_perform() |> 
  resp_body_json(simplifyVector = TRUE)

